import React from "react";
import "../css/Note.css";
import Button from "@material-ui/core/Button";
import DeleteIcon from '@material-ui/icons/Delete'

const Note = ({title,content}) => {
    return (
        <>
            <div className="note">
                <h3>{title}</h3>
                <p>{content}</p>
                <Button type='text'>
                    <DeleteIcon/>
                </Button>
            </div>
        </>
    );
};

export default Note;
